MongoDB - Get latest non-null field value from documents with timestamp<p>In the MongoDB collection I'm querying, each document represents some data for a parcel at a specific time. Every time I receive an update for a parcel, some fields may be updated (non-null value) and some others are not (null values).</p>
<p>To illustrate, consider this example. We received 3 data sets for a parcel:</p>
<pre><code>/* 1 */
{
    &quot;parcelNum&quot; : &quot;CC123456789FR&quot;,
    &quot;datetime&quot; : ISODate(&quot;2018-09-05T10:48:38.584Z&quot;),
    &quot;field1&quot; : &quot;value1_1&quot;,
    &quot;field2&quot; : &quot;value2_1&quot;
}

/* 2 */
{
    &quot;parcelNum&quot; : &quot;CC123456789FR&quot;,
    &quot;datetime&quot; : ISODate(&quot;2018-09-05T10:48:40.566Z&quot;),
    &quot;field1&quot; : &quot;value1_2&quot;,
    &quot;field2&quot; : null
}

/* 3 */
{
    &quot;parcelNum&quot; : &quot;CC123456789FR&quot;,
    &quot;datetime&quot; : ISODate(&quot;2018-09-05T10:48:42.777Z&quot;),
    &quot;field1&quot; : null,
    &quot;field2&quot; : &quot;value2_2&quot;
}
</code></pre>
<p><strong>How can I extract the latest non-null value, for all fields, considering the timestamp of the document they belong to?</strong></p>
<p>Using the previous example, this is what I try to get:</p>
<pre><code>{
    &quot;parcelNum&quot; : &quot;CC123456789FR&quot;,
    &quot;field1&quot; : &quot;value1_2&quot;,
    &quot;field2&quot; : &quot;value2_2&quot;
}
</code></pre>
<p>I tried that kind of query but I can't find how to mix field values from multiple documents:</p>
<pre><code>db.testDB.aggregate([
    {$sort: { datetime: -1 }},
    {$group: { _id: &quot;$parcelNum&quot;, 
        field1: {$first: &quot;$field1&quot; },
        field2: {$first: &quot;$field2&quot; }
    }}
])
</code></pre>
<p>gives me:</p>
<pre><code>{
    &quot;_id&quot; : &quot;CC123456789FR&quot;,
    &quot;field1&quot; : null,
    &quot;field2&quot; : &quot;value2_2&quot;
}
</code></pre>
<p>which is wrong because it only uses values from the most recent document and doesn't mix all the documents.</p>
<p>I tried another approach suggested by Rishi in another topic. Instead of creating a new document for each revision, he suggested pushing revision sub-documents onto an array and maintaining the latest revision at the parent document.</p>
<p>Something like this:</p>
<pre><code>{
    parcelNum: CC123456789FR,
    lastUpdated: ISODate(&quot;2018-09-05T10:48:42.777Z&quot;)
    field1: &quot;value1_2&quot;,
    field2: &quot;value2_2&quot;,
    revisions: [
        {
            datetime: ISODate(&quot;2018-09-05T10:48:38.584Z&quot;),
            field1: &quot;value1_1&quot;,
            field2: &quot;value2_1&quot;
        },
        {
            datetime: ISODate(&quot;2018-09-05T10:48:40.566Z&quot;),
            field1: &quot;value1_2&quot;,
            field2: null
        },
        {
            datetime: ISODate(&quot;2018-09-05T10:48:42.777Z&quot;),
            field1: null,
            field2: &quot;value2_2&quot;
        }
    ]
}
</code></pre>
<p>However, maintaining the latest revision is not that easy because updates are not received in a chronological order then I can receive a &quot;new&quot; document which has an older &quot;datetime&quot; field value and then I must not update the fields except if they are null. Therefore, I would have to record the last update timestamp for all fields if I want to do so!</p>

