</code></pre>
<p>I tried that kind of query but I can't find how to mix field values from multiple documents:</p>
<pre><code>db.testDB.aggregate([
    {$sort: { datetime: -1 }},
    {$group: { _id: &quot;$parcelNum&quot;, 
        field1: {$first: &quot;$field1&quot; },
        field2: {$first: &quot;$field2&quot; }
    }}
])
</code></pre>
<p>gives me:</p>
<pre><code>{
    &quot;_id&quot; : &quot;CC123456789FR&quot;,
    &quot;field1&quot; : null,
    &quot;field2&quot; : &quot;value2_2&quot;
