</code></pre>
<p>which is wrong because it only uses values from the most recent document and doesn't mix all the documents.</p>
<p>I tried another approach suggested by Rishi in another topic. Instead of creating a new document for each revision, he suggested pushing revision sub-documents onto an array and maintaining the latest revision at the parent document.</p>
<p>Something like this:</p>
