        }
    ]
}
</code></pre>
<p>However, maintaining the latest revision is not that easy because updates are not received in a chronological order then I can receive a &quot;new&quot; document which has an older &quot;datetime&quot; field value and then I must not update the fields except if they are null. Therefore, I would have to record the last update timestamp for all fields if I want to do so!</p>; Answer: I suspect you're getting the view size before it's set up, in other words I suspect it's 0.  I get the view size differently, I'll edit my answer.

