Mongoose $slice and get orginal size array<p>I'm currently trying to get the total amount of items in my News object, and return a slice of the items as objects. 
I found out how to use the $slice operator in my query, but I don't know how to get the original size of the array of items.
The code I'm currently using in NodeJS: </p>

<pre><code>if (req.query.limit) {
    limit = 5;
}
News.findOne({ connected: club._id }, {items: {$slice: limit}}).exec(function (err, news) {
    if (err) {
        return res.status(400).send({
            message: errorHandler.getErrorMessage(err)
        });
    } else if (!news || news.items.length === 0) {
        res.jsonp([]);
    } else {
        const returnObj = { items: [], totalNumber: 0 };
        const items = news.items.sort(function (a, b) {
            return b.date - a.date
        });
        res.jsonp({
            items: items,
            totalNumber: news.items.length
        });
    }
});
</code></pre>

<p>The Mongo model: </p>

<pre><code> var mongoose = require('mongoose'),
 validator = require('validator'),
 Schema = mongoose.Schema;

 var NewsSchema = new Schema({
 connected: {
  type: Schema.Types.ObjectId,
  required: 'Gelieve een club toe te wijzen.',
  ref: 'Club'
 },
 items: [{
  userFirstName: String,
  action: String,
  date: Date,
  targetName: String
 }],
 created: {
  type: Date,
  default: Date.now
 }
});

module.exports = mongoose.model('News', NewsSchema);
</code></pre>

<p>How would I do this efficiently?</p>

<p>Thanks!</p>

<p>EDIT: final code which works: </p>

<pre><code>News.aggregate([{
    $match: {
        connected: club._id
    }
}, {
    $project: {
        totalNumber: {
            $size: '$items'
        },
        items: {
            $slice: ['$items', limit]
        }
    }
}
]).exec(function (err, news) {
    console.log(news);
    if (!news || news[0].items.length === 0) {
        res.jsonp([]);
    } else {
        res.jsonp(news[0]);
    }
});
</code></pre>

